(1, 'Upgrade Pesan CWJA', '2019-11-25 08:00:00', '<p>Hallo sobat CWJA,</p>\r\n<p>Dengan diberlakukannya sistem baru yang disebut Portal CWJA, sistem <strong>pesan.cwabali.com&nbsp;</strong>akan dialihkan ke&nbsp;<strong>portal.cwabali.com</strong> dengan penambahan beberapa fitur baru seperti :</p>\r\n<ol>\r\n<li>Pengumuman Internal (Bersifat global).</li>\r\n<li>Penjualan PU (Tonase untuk SCM).</li>\r\n<li>E-Form (HRD &amp; Penanganan IT) : Masih dalam tahap percobaan di pusat.</li>\r\n<li>Notifikasi pada saat pengiriman email internal pesan, pengajuan form online, dan pengumuman baru.</li>\r\n</ol>\r\n<p>Dengan adanya pengupgrade an sistem baru, diharapkan dapat membantu dan mempermudah dalam hal bekerja. Untuk melakukan login kedalam sistem masukkan email sebelumnya, contoh : <strong>test@cwabali.com&nbsp;</strong>kemudian masukkana password defaultnya : <strong>123456,</strong> setelah anda login kedalam sistem. pastikan mengubah password utama pada menu ubah password -&gt; user password demi keamanan data anda.</p>\r\n<p>Terima kasih,</p>\r\n<p>IT Support</p>', '2020-11-28', '1', 1, '2019-11-25 00:00:00', '2019-12-05 05:29:53'),
(2, 'Update Nomor Telfon Dept. Finance', '2019-11-25 17:02:29', '<p class="MsoNormal" style="line-height: 115%; text-align: justify;"><span style="font-family: ''Times New Roman'', serif; font-size: 12pt;">Diinformasikan kepada seluruh Departemen di PT Citra Warna Jaya Abadi, bahwa terdapat perubahan nomor telfon Departemen Finance </span><strong style="font-family: ''Times New Roman'', serif; font-size: 12pt;">khusus untuk cek transferan dan laporan penjualan ke no 081294204307</strong><span style="font-family: ''Times New Roman'', serif; font-size: 12pt;">,nomor lama masih dapat digunakan untuk menghubungi hal-hal diluar dari cek transferan dan laporan penjualan, mohon diinformasikan ke departemen masing-masing.</span></p>\r\n<p class="MsoNormal" style="line-height: 150%; text-align: justify;"><span style="font-size: 12pt; line-height: 150%; font-family: ''Times New Roman'', serif;">Demikian </span><span lang="EN-US" style="font-size: 12pt; line-height: 150%; font-family: ''Times New Roman'', serif;">pengumuman ini kami sampaikan, diharapkan kepala bagian untuk mensosialisasikan hal tersebut ke anggota departemenya. Atas perhatianya kami ucapkan terimakasih.</span></p>', '2019-11-28', '1', 36, '2019-11-25 09:02:29', '2019-11-25 09:04:30'),
(3, 'test', '2019-11-27 10:20:16', '<p>asjndjkasdn</p>', '2019-11-26', '1', 1, '2019-11-27 03:20:16', '2019-11-27 07:25:18'),
(4, 'test tanggal', '2019-11-27 14:41:39', '<p>asdasbd</p>', '2019-11-29', '1', 1, '2019-11-27 07:41:39', '2019-11-27 07:43:24');
